import React, { Component } from 'react';

class Product extends Component {
  render() {
    const {imageUrl, offerText, brandName, productName, price, mrf, quantity} = this.props.product;
    return (
      <tr style={{}}>
        <th style={{}}>
          <img style={{}} src={imageUrl} alt="product" />
          <div>{offerText} OFF</div>
        </th>
        <th style={{}}>
          <div>{brandName}</div>
          <div>{productName}</div>
          <div>{quantity}</div>
          <div>{price}</div>
          <div>{mrf}</div>
        </th>
        <tr><th><button>Test</button></th></tr>
      </tr>
    );
  }
}

export default Product;
